import { items } from "../UI/data/Items";


const Cart = props => {

    const [items, setItems] = useState([]);
    useEffect(() => {
        setItems([...items, props.cartItems])
    }, [props.cartItems]);

    console.log(items.slice(1));
    return <div>
        <ul>{
            items.map(item=>{
                <li>{items}</li>
            })
        }</ul>
    </div>

}

export default Cart;
